import React,{useContext} from "react";
import { Link } from "react-router-dom";
import { prodactsConext } from "../context/contextData";

const NavBar = () => {
    const { data, dispatch, user, dispatchUser } = useContext(prodactsConext);
  return (
      <div className="navbar container">
          <div className="navSearch">
              <div >hello pretty maha</div>
          <input className="navInput" type="text"/>  
          </div>
          <div className="navUserlist">
             {user.user ? (
          <div

                  className="navName logout"
            onClick={() => {
              dispatchUser({ type: "LOGOUT_USER", payload: '' })
              let keysToRemove = ["user", "x-auth"];
              for (let key of keysToRemove) {
                localStorage.removeItem(key);
              }
            }
          }
          >
            logout
          </div>
        ) : (
          <Link to="/login">Login</Link>
          )}
          {user.user ? (
          <div className="navName">
            Hi!.. {user.user.firstName} {user.user.lastName}
          </div>
        ) : (
          ""
        )}  
        </div>


    </div>
  );
};

export default NavBar;
